import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <Router>
          <Switch>
              <Route path="/" exact><Home />  </Route>
              <Route path="/login" exact><Login LoginHandler = {LoginHandler} user = {user}/></Route>
              <Route path="/sign-up" exact><Signup/></Route>
          </Switch>
        </Router>

      </div>
  );
}

export default App;
